import React from 'react';

const Comment = props => {
  const { name, email, body } = props.comment;

  return (
    <div>
      <div>
        <h3>{name}</h3>
        <p>{email}</p>
      </div>

      <p>{body}</p>
    </div>
  );
};

export default Comment;
